// src/pages/Home.js
import React from 'react';
import Hero from '../components/Hero';
import ProductList from '../components/ProductList';
import BlogSection from '../components/BlogSection';
import Footer from '../components/Footer';

const Home = () => {
  return (
    <div>
      <Hero />
      <ProductList />
      <BlogSection />
      <Footer />
    </div>
  );
};

export default Home;
